import React from 'react';
import Card from './Card';
import './CardList.css';


const click = () => {
	alert('clicked');
}

const CardList = ({data}) => {

	return (

		<div className='listcards' >
			{
				data.map((user , i)=> {
					return <Card key={i} robots={data[i]} run={click} />;
				})

			}
		</div>

	);
}

export default CardList;
